class Solution(object):
    def isSubsequence(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: bool
        """
        sPtr = len(s) - 1
        tPtr = len(t) - 1
        while tPtr >= 0 and sPtr >= 0:
            if t[tPtr] == s[sPtr]:
                sPtr-=1
            tPtr-=1
        if sPtr < 0:
            return True
        else:
            return False

if __name__ == '__main__':
    obj = Solution()
    print(obj.isSubsequence("gggsgguggggbsggggggggggggggggggggegggggggggggqgugggegggggggggggggggngggggggcggggggggggggeggggggggggg", ""))